select(2, ...).LoadData("APP_INFO","Global",[[return {version=404,lastSync=1595597650,message={id=0,msg=""},news={{title="TradeSkillMaster v4.9.38 Changelog",content="TSM v4.9.38 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issues with buying commodities.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1595435491,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-38-changelog/"},{title="TSM 4.10: Beta Launch!",content="We're thrilled to announce the TSM 4.10 Beta test has begun! If you're a TSM Premium member you will shortly be receiving an email inviting you to participate, along with instructions on how to get started. Additional invites through our Beta sign-up page will be distributed on a First-In-First-Out system, so be sure to sign-up [...]",timestamp=1594744605,link="https://blog.tradeskillmaster.com/tsm-4-10-beta-launch/"},{title="TradeSkillMaster v4.9.37 Changelog",content="TSM v4.9.37 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] TOC bump for 1.13.5<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1594254596,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-9-37-changelog/"},{title="TSM 4.10: UI & Design",content="This is the second in a series of TSM 4.10 feature highlight blogs. Today we will be discussing the new User Interface and Designs in 4.10. This blog post is very GIF heavy to demonstrate the new functionality being discussed. Overall Look & Feel As we mentioned in an earlier teaser, one of the biggest [...]",timestamp=1593982610,link="https://blog.tradeskillmaster.com/tsm-4-10-ui-design/"},{title="TSM 4.10: New Sources",content="This is the first in a series of TSM 4.10 feature highlight blogs. Today we will introduce the new Price Sources and Value Sources, and new places you can use them in 4.10 Operation-Based Price Sources When you're setting up Auctioning Operations for example, you might have already set up a preferred maximum purchase price [...]",timestamp=1592932763,link="https://blog.tradeskillmaster.com/tsm-4-10-new-sources/"}}}]]) --<APP_INFO,Global,1595597650>
